import React, { Component } from "react";

class School extends Component {
    render() {
        return (
            <div id="school">
                <h2>FORMATION</h2>
                <br></br><br></br>
                <p><b>Web@cademie By Epitech</b></p>
                <p><i>2020</i></p>
                <p>Développeur-Intégrateur Web (Titre 5 RNCP - BAC +2)</p>
                <br></br><br></br>
                <p><b>Université Paris 3 Sorbonne Nouvelle</b></p>
                <p><i>2016</i></p>
                <p>Licence Langues Etrangères Appliquées</p>
                <br></br><br></br>
                <p><b>Lycée Gabriel Fauré</b></p>
                <p><i>2013</i></p>
                <p>BAC Economique et Social</p>
                <br></br><br></br>
            </div>
        );
    }
}

export default School;
